import React from "react";
import ModalImage from "react-modal-image"; 

<ModalImage
    alt = "hi"
  />
const Image = ({ url, title }) => (
  
    <li className="pop-out">
      <img  src={url} alt={title} />
    </li>
);

export default Image;
